import React, { useEffect } from "react";
import { ReactComponent as Album_heartIcon } from '../assets/icons/album_heart.svg';
import { Swiper, SwiperSlide } from 'swiper/react'
import 'swiper/css'

const dummy = [{
    image: 'https://images.unsplash.com/photo-1647891941746-fe1d53ddc7a6?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=387&q=80',
    weather: "How do you feel about Today's Weather?",
    fashionLog: "Show off your style!",

}, {
    image: 'https://images.unsplash.com/photo-1647891941746-fe1d53ddc7a6?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=387&q=80',
    weather: "How do you feel about Today's Weather?",
    fashionLog: "Show off your style!",

}, {
    image: 'https://images.unsplash.com/photo-1647891941746-fe1d53ddc7a6?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=387&q=80',
    weather: "How do you feel about Today's Weather?",
    fashionLog: "Show off your style!",

}]

export const MyDiaryPage = () => {

    useEffect(() => {
        fetch("https://localhost:1337/api/diaries").then((result) => result.json())
    })
    return (

        <div>

            <div className="font-lobster text-rose-500 py-6 text-center text-3xl">My Diary</div>

            <Swiper
                spaceBetween={50}
                slidesPerView={1}
                navigation
            >
                {dummy.map((data: any) => <SwiperSlide>
                    <div>
                        <div className="font-chakra ml-4 mb-2 font-semibold">Date:</div>
                        <div className="flex items-center justify-center relative">
                            <img src={data.image}></img>
                            <Album_heartIcon className="absolute z-100 bottom-0 right-4" />
                        </div>

                        <div className="font-chakra mt-6 ml-6 font-semibold text-xl">Weather</div> <div className="font-chakra text-lg text-center mt-4">{data.weather}</div>
                        <div className="border-y border-gray-300 mt-4 mb-4"></div>
                        <div className="font-chakra mt-6 ml-6 font-semibold text-xl">Fashion Log</div> <div className="font-chakra text-lg text-center mt-4">{data.fashionLog}</div>
                    </div>

                    <div>
                        <div className="bg-rose-400 py-4 mt-10 ml-12 mr-12 mb-6 text-white text-center font-lobster text-lg rounded-full">Diary Closed!</div>
                    </div>

                </SwiperSlide>)}

            </Swiper>



        </div >

    );
};
